    false,nt"url": null,nt"notes": "This annual narrative report for Becharof
    NWR outlines Refuge accomplishments during the 1981 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan
    and public participation. Refuge administration is outlined; information about personnel,
    youth programs, funding, safety, and technical assistance is given. Habitat management
    is also covered; subjects include fire management and wilderness areas. The wildlife
    section of the report discusses wildlife diversity, endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, marine
    mammals, and fisheries resources. The public uses of the Refuge described in this
    report include interpretive programs, hunting, fishing, trapping, wildlife observation,
    outdoor recreation, and law enforcement. The equipment and facilities section of
    the report provides information about rehabilitation, equipment replacement, and
    energy conservation. Cooperative programs and items of interest are provided at
    the end.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
